import PropTypes from 'prop-types'

const Item = ({itemName, lancamento}) => {
  return (
    <>
      <li>
        {itemName} - {lancamento}
      </li>
    </>
  )
}

Item.protoType = {
  marca: PropTypes.string,
}

export default Item
